A terrific panel discussion here at the NJGOP Summit on the opportunities and challenges of running for office at the federal, state, and local level.

Thanks to all who joined me with a great deal of helpful insights, Monmouth County Commissioner Sue Kiley, Darius Mayfield CD-12, Senator Ed Durr, Asssemblymembers Antwan McClellan & Kim Eulner, Schoolboard members Amber Murad, Joe Berg, & Tia Steinhardt, Assemblyman Don Guardian, Trenton Councilmember Jennifer Williams, & Bridgewater Mayor Matt Moench.

